import React from 'react';
import { useNavigate } from 'react-router-dom';
import Card from './Card';

export default function SGODashboard() {
  const navigate = useNavigate();

  const addCSOPage = () => {
    navigate('/addCSO');
  };

  // const cards = () => (
  //   <>
  //     <Card imageUrl="../images/students.png" description="Students" />
  //     <Card imageUrl="../images/executive.png" description="Executives" />
  //     <Card imageUrl="../images/society.png" description="CSOs" />
  //   </>
  // );

  return (
    <main>
      <h1>SGO Dashboard</h1>
      <p>
        Welcome, SGO member! Here you can manage clubs, approve events, and view
        student activities.
      </p>
      <button onClick={addCSOPage}>Add CSO</button>

      
    </main>
  );
}
